import React from "react";
import "../App.css";
import { Link } from "react-router-dom";

function Nav() {
  const navStyle = {
    color: "white"
  };

  return (
    <nav>
      <Link style={navStyle} to="/">
      <h2>MyReactApp</h2>
      </Link>
      <ul className="nav-links">
        <Link style={navStyle} to="/">
          <li>About</li>
        </Link>
        <Link style={navStyle} to="/Weather">
          <li>Weather</li>
        </Link>
        <Link style={navStyle} to="/Recipes">
          <li>Recipes</li>
        </Link>
        <Link style={navStyle} to="/Corona">
          <li>CoronaTracker</li>
        </Link>
      </ul>
    </nav>
  );
}

export default Nav;
